DROP DATABASE IF EXISTS av;
CREATE DATABASE av;
USE av;

create table material_construcao (
	id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
	nome VARCHAR(50),
	valor FLOAT
)ENGINE = InnoDB;

CREATE TABLE construcao(
	id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
	nome VARCHAR(500),
    previsao_entrega DATE NOT NULL
)ENGINE = InnoDB;

CREATE TABLE construcao_usa_material_construcao(
	id INT AUTO_INCREMENT PRIMARY KEY NOT NULL,
	construcao_id INT,
    material_construcao_id INT,
    quantidade INT,
    FOREIGN KEY FK_DASJAJLDSA (construcao_id) REFERENCES construcao(id),
    FOREIGN KEY FK_DASJSADAJLDSA (material_construcao_id) REFERENCES material_construcao(id)
)ENGINE = InnoDB;



